import React from "react";
import styles from "./DownloadNotification.module.scss";
import { Button } from "@material-ui/core";
const DownloadNotification = () => {
  return <div className={styles.notification}>
      <div>
          <p>Cách 1: Truy cập Appstore</p>
          <Button variant='outlined'>Appstore</Button>
      </div>
      <div>
          <p>Cách 2: Quét QR Code</p>

      </div>
  </div>
};

export default DownloadNotification;
